import React from 'react'

interface ButtonProps{
    digit:string,
    handleAddDigits?:()=> string,
    className?:string,
    setPressedDigit?:React.Dispatch<React.SetStateAction<string>>

}

const Button=({digit ,className ,handleAddDigits ,setPressedDigit}:ButtonProps) => {
  return (
    <input className={className}  type="button" value={digit} onClick={handleAddDigits} onChange={(e)=>  setPressedDigit?.(e.target.value)} />
  )
}

export default Button
